%[text] ## Liver analysis pipeline
%[text] Main script to run the liver and tumor segmentation pipeline.
clear; clc; clf; close all; % Clean slate

disp("Liver Segmentation Pipeline Started"); %[output:8b42f2c5]

% --- Configuration Parameters ---
% General
config.verbose = true; % Flag for displaying intermediate images/messages
config.pauseDuration = 0.001; % Pause duration for visualizations

% Data Paths
config.imagePath = 'data/imagesTr/liver_80.nii.gz';
config.labelPath = 'data/labelsTr/liver_80.nii.gz';

% Preprocessing
config.roiParams = struct('x', 35, 'y', 38, 'r', 30); % For initial normalization
config.maxValue = 65535; % Max value for uint16 images
config.nBins = 65536;
config.histGroupSize = 2000;

% Bone Removal Pass 1
config.boneRemoval1.window = 10;
config.boneRemoval1.thresholdFactor = 0.95;
config.boneRemoval1.dilateDiskRadius = 4;
config.boneRemoval1.erodeDiskRadius = 2;
config.boneRemoval1.gaussianSize = 10;

% Bone Removal Viz Pass
config.boneRemovalViz.window = 1;
config.boneRemovalViz.thresholdFactor = 0.95;
config.boneRemovalViz.dilateDiskRadius = 4;
config.boneRemovalViz.erodeDiskRadius = 2;
config.boneRemovalViz.gaussianSize = 10;

% Stretching Pass 1
config.stretch1.stretchFactor = 8;

% Bone Masking Pass 2 (Mask Array)
config.boneMask2.thresholdFactor = 0.13; % Applied to doubleStretchedSlice_temp
config.boneMask2.dilateDiskRadius = 4;
config.boneMask2.erodeDiskRadius = 4;
config.boneMask2.gaussianSize = 10;

% Histogram Matching
config.histMatch.referenceSliceIndex = 150; % Example, adjust as needed

% Bilateral Filtering Pass 1
config.bilatFilt1.DoS = 0.04; % Degree of Smoothing
config.bilatFilt1.sSigma = 4;  % Spatial Sigma

% Liver Segmentation (Initial Thresholding)
config.liverSeg.lowerThreshold = 0.06;
config.liverSeg.upperThreshold = 0.28;
config.liverSeg.imfillConn = 18;
config.liverSeg.openStrelDiskSize = 5;

% Liver Segmentation (2D Refinement)
config.liverRefine2D.minLiverArea = 100;
config.liverRefine2D.seCloseDisk = 7;
config.liverRefine2D.seOpenDisk = 5;

% Liver Segmentation (3D Refinement)
config.liverRefine3D.sphereStrelRadius = 4;
config.liverRefine3D.minLiverVolumeVoxels = 300000;
config.liverRefine3D.connectivity = 18;

% Liver Mask Post-Processing
config.liverPostProcess.nRowsFractionForBottom = 1.5;
config.liverPostProcess.connectivity3D = 26;

% Final Stretching
config.stretchFinal.lowerIntensityFactor = 0.42;
config.stretchFinal.upperIntensityFactor = 0.55;
config.stretchFinal.stretchFactor = 2;

% Bilateral Filtering Pass 2
config.bilatFilt2.DoS = 0.04;
config.bilatFilt2.sSigma = 7;

% Tumor Segmentation
config.tumorSeg.lowerThreshold = 0.03;
config.tumorSeg.upperThreshold = 0.23;
config.tumorSeg.minTumorVolumeVoxels = 30000;
config.tumorSeg.openStrelSphereRadius = 5;
config.tumorSeg.closeStrelDiskRadius2D = 3;
config.tumorSeg.connectivity3D = 18;

% 3D Reconstruction
config.recon3D.liverColor = [0 1 0];
config.recon3D.tumorColor = [1 0 0];
config.recon3D.bonesColor = [0.9 0.9 0.8];
config.recon3D.liverAlpha = 0.4;
config.recon3D.tumorAlpha = 1.0;
config.recon3D.bonesAlpha = 0.7;
config.recon3D.smoothing = true;
config.recon3D.smoothFactor = 5;
%%
%[text] ### Pipeline Stages
%%
%[text] 1\. Load Data
disp('1. Loading data...'); %[output:4cca286b]
[trainVolume, labelVolume] = data_io.loadNiiVolumes(...
    config.imagePath, ...
    config.labelPath);
fprintf('Training volume size: %s\n', mat2str(size(trainVolume))); %[output:8a0ea526]
if config.verbose %[output:group:30bf3c8c]
    visualization.viewVolumeSlices(... %[output:71f9961d]
        trainVolume, ... %[output:71f9961d]
        labelVolume, ... %[output:71f9961d]
        'Original Data', ... %[output:71f9961d]
        config.pauseDuration, ... %[output:71f9961d]
        true, ... %[output:71f9961d]
        true);
end %[output:group:30bf3c8c]
%%
%[text] 2\. ROI\-based Normalization
disp('2. Normalizing volume based on ROI...'); %[output:750b2413]
[normalizedSlice, roiMeanValue] = preprocessing.normalizeVolumeByRoi(...
    trainVolume, ...
    config.roiParams, ...
    config.maxValue);
fprintf('Mean value in ROI for normalization: %.2f\n', roiMeanValue); %[output:0a05e1d1]


visualization.viewVolumeSlices(trainVolume, normalizedSlice, "test", config.pauseDuration, true, false); %[output:3bada49e]
%%
%[text] 3\. Initial Histogram Analysis
disp('3. Initial histogram analysis...'); %[output:0628ea44]
[hMean, hMean_clean] = histogram_tools.calculateVolumeHistogram(...
    normalizedSlice, ...
    config.nBins);
if config.verbose %[output:group:54c0dcef]
    visualization.plotHistogramComparison(... %[output:24a32073]
        hMean, ... %[output:24a32073]
        hMean_clean, ... %[output:24a32073]
        'Initial Histograms'); %[output:24a32073]
end %[output:group:54c0dcef]
[grouped_hMean, grouped_hMean_clean, binCenters] = histogram_tools.groupHistogram(...
    hMean, ...
    hMean_clean, ...
    config.histGroupSize, ...
    config.nBins);
[lowerIntensity1, upperIntensity1] = histogram_tools.detectHistogramBand(grouped_hMean_clean);
if config.verbose %[output:group:05ed82b5]
    visualization.plotGroupedHistogramWithBand(... %[output:986455f2]
        binCenters, ... %[output:986455f2]
        grouped_hMean, ... %[output:986455f2]
        grouped_hMean_clean, ... %[output:986455f2]
        config.nBins, ... %[output:986455f2]
        lowerIntensity1, ... %[output:986455f2]
        upperIntensity1, ... %[output:986455f2]
        'Grouped Histograms - Band 1'); %[output:986455f2]
end %[output:group:05ed82b5]
%%
%[text] 4\. Stretch Slices (Pass 1)
disp('4. Stretching slices (Pass 1)...'); %[output:322ea402]
nSlices_stretch1 = size(normalizedSlice, 3);
wb_stretch1 = waitbar(0, 'Stretching Slices (Pass 1) - Initializing...');

stretchedSlice1 = preprocessing.stretchVolumeContrast(...
    normalizedSlice, ...
    lowerIntensity1, ...
    upperIntensity1, ...
    config.stretch1.stretchFactor, ...
    config.maxValue, ...
    wb_stretch1);

if isvalid(wb_stretch1), close(wb_stretch1); end
%%
%[text] 5\. Bone Removal (Pass 1)
disp('5. Removing bone structures (Pass 1)...'); %[output:63695c47]
[no_bones_slice, bones_mask_pass1] = preprocessing.removeHighIntensityArtifacts(... %[output:group:1e776cf2] %[output:9338cd65]
    normalizedSlice, ... %[output:9338cd65]
    stretchedSlice1, ... %[output:9338cd65]
    config.maxValue, ... %[output:9338cd65]
    config.boneRemoval1, ... %[output:9338cd65]
    config.verbose, ... %[output:9338cd65]
    config.pauseDuration); %[output:group:1e776cf2] %[output:9338cd65]

[~, bones_mask_viz] = preprocessing.removeHighIntensityArtifacts(...
    normalizedSlice, ...
    stretchedSlice1, ...
    config.maxValue, ...
    config.boneRemovalViz, ...
    false);
%%
%[text] 6\. Histogram Analysis After Bone Removal
disp('6. Histogram analysis after bone removal...'); %[output:72481999]
[hMean_no_bones, hMean_clean_no_bones] = histogram_tools.calculateVolumeHistogram(...
    no_bones_slice, ...
    config.maxValue);
[grouped_hMean_no_bones, grouped_hMean_clean_no_bones, binCenters_nb] = ...
    histogram_tools.groupHistogram(...
        hMean_no_bones, ...
        hMean_clean_no_bones, ...
        config.histGroupSize, ...
        config.maxValue);
[lowerIntensity2, upperIntensity2] = histogram_tools.detectHistogramBand(grouped_hMean_clean_no_bones);
if config.verbose %[output:group:4e05b122]
    visualization.plotGroupedHistogramWithBand(... %[output:8e94f9f3]
        binCenters_nb, ... %[output:8e94f9f3]
        grouped_hMean_no_bones, ... %[output:8e94f9f3]
        grouped_hMean_clean_no_bones, ... %[output:8e94f9f3]
        config.maxValue, ... %[output:8e94f9f3]
        lowerIntensity2, ... %[output:8e94f9f3]
        upperIntensity2, ... %[output:8e94f9f3]
        'Histograms After Bone Removal - Band 2'); %[output:8e94f9f3]
end %[output:group:4e05b122]
%%
%[text] 7\. Double Stretching (Stretch Slices Pass 2)
disp('7. Stretching slices (Pass 2)...'); %[output:2b1e99ac]
nSlices_stretch2 = size(no_bones_slice, 3);
wb_stretch2 = waitbar(0, 'Stretching Slices (Pass 2) - Initializing...');

doubleStretchedSlice = preprocessing.stretchVolumeContrast(...
    no_bones_slice, ...
    lowerIntensity2, ...
    upperIntensity2, ...
    6, ... % Stretch factor 6 from script
    config.maxValue, ...
    wb_stretch2);

if isvalid(wb_stretch2), close(wb_stretch2); end

if config.verbose %[output:group:871f0dbd]
    visualization.viewVolumeSlices(doubleStretchedSlice, [], 'Double Stretched Slices', config.pauseDuration); %[output:319534e7]
end %[output:group:871f0dbd]
%%
%[text] 8\. Create Mask Array (Structure Removal Pass 2)
disp('8. Creating secondary structure mask...'); %[output:55fbe558]
structure_mask_array = preprocessing.createStructureMask(... %[output:group:862d84e7] %[output:4900ca9f]
    doubleStretchedSlice, ... %[output:4900ca9f]
    config.maxValue, ... %[output:4900ca9f]
    config.boneMask2, ... %[output:4900ca9f]
    config.verbose, ... %[output:4900ca9f]
    config.pauseDuration); %[output:group:862d84e7] %[output:4900ca9f]
%%
%[text] 9\. Histogram Matching
disp('9. Applying histogram matching...'); %[output:30aea3c7]
nSlices_histmatch = size(doubleStretchedSlice, 3);
wb_histmatch = waitbar(0, 'Histogram Matching - Initializing...');

matched_after_double_stretch = preprocessing.matchHistogramToReference(...
    doubleStretchedSlice, ...
    config.histMatch.referenceSliceIndex, ...
    wb_histmatch);

if isvalid(wb_histmatch), close(wb_histmatch); end
%%
%[text] 10\. Apply Structure Mask
disp('10. Applying structure mask...'); %[output:18506b5b]
masked_volume = preprocessing.applyMask(...
    matched_after_double_stretch, ...
    ~structure_mask_array);
if config.verbose %[output:group:918a7dfc]
     visualization.viewVolumeSlices(masked_volume, [], 'Volume After Structure Mask', config.pauseDuration); %[output:2fa74530]
end %[output:group:918a7dfc]
%%
%[text] 11\. Bilateral Filtering (Pass 1)
disp('11. Applying bilateral filter (Pass 1)...'); %[output:08874869]
nSlices_bilat1 = size(masked_volume, 3);
wb_bilat1 = waitbar(0, 'Bilateral Filtering (Pass 1) - Initializing...');

bilat_filtered_volume1 = preprocessing.applyBilateralFilter(...
    masked_volume, ...
    config.bilatFilt1.DoS, ...
    config.bilatFilt1.sSigma, ...
    config.maxValue, ...
    wb_bilat1);

if isvalid(wb_bilat1), close(wb_bilat1); end

if config.verbose %[output:group:2bd5a786]
    visualization.viewVolumeSlices(bilat_filtered_volume1, masked_volume, 'Bilateral Filter vs Before', config.pauseDuration); %[output:2d0b2899]
end %[output:group:2bd5a786]
%%
%[text] ### Liver Segmentation
disp('--- Starting Liver Segmentation ---'); %[output:7156e5fc]
%%
%[text] 12\. Get Initial Liver Thresholds (Optional)
% sliceForROI = bilat_filtered_volume1(:,:,156);
% [manualLower, manualUpper] = visualization.getThresholdsFromRoiInteractive(sliceForROI, 'Draw ROI on Liver for Thresholds');
% config.liverSeg.lowerThreshold = manualLower;
% config.liverSeg.upperThreshold = manualUpper;
% fprintf('Using thresholds from ROI: Lower=%.3f, Upper=%.3f\n', config.liverSeg.lowerThreshold, config.liverSeg.upperThreshold);
%%
%[text] 13\. Initial Liver Segmentation (2D Thresholding & MorphOps)
disp('13. Initial liver segmentation (2D)...'); %[output:7be6265e]
initialLiverMask = segmentation.segmentLiverByThreshold2D(... %[output:group:26bc04d5] %[output:4e81a304]
    bilat_filtered_volume1, ... %[output:4e81a304]
    config.liverSeg.lowerThreshold, ... %[output:4e81a304]
    config.liverSeg.upperThreshold, ... %[output:4e81a304]
    config.liverSeg.imfillConn, ... %[output:4e81a304]
    config.liverSeg.openStrelDiskSize, ... %[output:4e81a304]
    config.maxValue, ... %[output:4e81a304]
    config.verbose, ... %[output:4e81a304]
    config.pauseDuration); %[output:group:26bc04d5] %[output:4e81a304]
%%
%[text] 14\. Refine Liver Segmentation (2D MorphOps)
disp('14. Refining liver segmentation (2D)...'); %[output:6d80c1c0]
refinedLiverMask2D = segmentation.refineLiverMask2D(... %[output:group:2ec5c675] %[output:664e805b]
    initialLiverMask, ... %[output:664e805b]
    config.liverRefine2D.minLiverArea, ... %[output:664e805b]
    config.liverRefine2D.seCloseDisk, ... %[output:664e805b]
    config.liverRefine2D.seOpenDisk, ... %[output:664e805b]
    config.verbose, ... %[output:664e805b]
    config.pauseDuration); %[output:group:2ec5c675] %[output:664e805b]
%%
%[text] 15\. Refine Liver Segmentation (3D MorphOps)
disp('15. Refining liver segmentation (3D)...'); %[output:533d6da8]
refinedLiverMask3D = segmentation.refineMask3DLargestComponent(... %[output:group:51cb6c8c] %[output:3b38342e]
    initialLiverMask, ... %[output:3b38342e]
    config.liverRefine3D.sphereStrelRadius, ... %[output:3b38342e]
    config.liverRefine3D.minLiverVolumeVoxels, ... %[output:3b38342e]
    config.liverRefine3D.connectivity, ... %[output:3b38342e]
    config.verbose, ... %[output:3b38342e]
    config.pauseDuration, ... %[output:3b38342e]
    bilat_filtered_volume1); %[output:group:51cb6c8c] %[output:3b38342e]
%%
%[text] 16\. Post\-process Liver Mask
disp('16. Post-processing liver mask (connectivity)...'); %[output:5d4922f8]
finalProcessedLiverMask = segmentation.postProcessLiverMaskConnectivity(... %[output:group:9de800c8] %[output:36a74a34]
    refinedLiverMask3D, ... %[output:36a74a34]
    size(trainVolume,1), ... %[output:36a74a34]
    config.liverPostProcess.nRowsFractionForBottom, ... %[output:36a74a34]
    config.liverPostProcess.connectivity3D, ... %[output:36a74a34]
    config.verbose, ... %[output:36a74a34]
    config.pauseDuration, ... %[output:36a74a34]
    bilat_filtered_volume1); %[output:group:9de800c8] %[output:36a74a34]
%%
%[text] ### Tumor Segmentation
disp('--- Starting Tumor Segmentation ---'); %[output:8f4112e5]
%%
%[text] 17\. Prepare Volume for Tumor Segmentation
liverOnlyVolume = preprocessing.applyMask(...
    no_bones_slice, ...
    finalProcessedLiverMask);
if config.verbose %[output:group:427ac120]
    visualization.viewVolumeSlices(liverOnlyVolume, [], 'Liver-Only Intensity Volume (Pre-Tumor Seg)', config.pauseDuration); %[output:155181c3]
end %[output:group:427ac120]
%%
% 18. Histogram Analysis and Stretching for Liver-Only Volume
lowerIntensity_final = 0.42;
upperIntensity_final = 0.55;

[hMean_final, hMean_clean_final] = histogram_tools.calculateVolumeHistogram(liverOnlyVolume, config.maxValue);
[grouped_hMean_final, grouped_hMean_clean_final, binCenters_final] = ...
    histogram_tools.groupHistogram(hMean_final, ...
                                   hMean_clean_final, ...
                                   config.histGroupSize, ...
                                   config.maxValue);
% [lowerIntensity_final, upperIntensity_final] = histogram_tools.detectHistogramBand(hMean_clean_final, 3000);
if config.verbose %[output:group:7b0fb803]
    visualization.plotGroupedHistogramWithBand(binCenters_final, ... %[output:936978cc]
                                               grouped_hMean_final, ... % Use grouped histogram %[output:936978cc]
                                               grouped_hMean_clean_final, ... % Use grouped histogram %[output:936978cc]
                                               config.maxValue, lowerIntensity_final, upperIntensity_final, 'Histograms for Final Stretch'); %[output:936978cc]
end %[output:group:7b0fb803]

wb_histmatch = waitbar(0, 'Histogram Matching - Initializing...');

stretched_liver_only = preprocessing.stretchVolumeContrast( ...
    no_bones_slice, ...
    lowerIntensity_final, ...
    upperIntensity_final, ...
    config.stretchFinal.stretchFactor, ...
    config.maxValue);
matched_stretched_liver_only = preprocessing.matchHistogramToReference( ...
    stretched_liver_only, ...
    config.histMatch.referenceSliceIndex, ...
    wb_histmatch);

inputToTumorSeg = preprocessing.applyMask( ...
    matched_stretched_liver_only, ...
    finalProcessedLiverMask);

if isvalid(wb_histmatch), close(wb_histmatch); end

if config.verbose %[output:group:62babe77]
    visualization.viewVolumeSlices(liverOnlyVolume, inputToTumorSeg, 'Input to Tumor Segmentation vs Label', config.pauseDuration); %[output:21b17c90]
end %[output:group:62babe77]
%%
%[text] 19\. Bilateral Filtering for Tumor Segmentation Input (Pass 2)
disp('19. Applying bilateral filter (Pass 2) for tumor segmentation input...'); %[output:41b7f583]

wb_bilat2 = waitbar(0, 'Bilateral Filter - Initializing...');

bilat_filtered_for_tumors = preprocessing.applyBilateralFilter(...
    inputToTumorSeg, ...
    config.bilatFilt2.DoS, ...
    config.bilatFilt2.sSigma, ...
    config.maxValue, ...
    wb_bilat2);

if isvalid(wb_bilat2), close(wb_bilat2); end

if config.verbose %[output:group:670049a3]
    visualization.viewVolumeSlices(bilat_filtered_for_tumors, labelVolume, 'Input to Tumor Segmentation vs Label', config.pauseDuration, false, true); %[output:898f4d96]
end %[output:group:670049a3]
%%
slice_idx = 157;
slice = double(bilat_filtered_for_tumors(:,:,slice_idx)) / double(config.maxValue);
figure; %[output:85666571]
imshow(slice, []); %[output:85666571]
title('Disegna una ROI nel fegato'); %[output:85666571]
roi = drawpolygon; % O drawpolygon, drawellipse... %[output:85666571] %[output:033d51d6]
wait(roi); % Attendi che l'utente finisca di disegnare
mask = createMask(roi);
liver_pixels = slice(mask); % Estrai i pixel della ROI
figure; %[output:76381b69]
imhist(liver_pixels); %[output:76381b69]
title('Istogramma della ROI nel fegato'); %[output:76381b69]
%%
%[text] 20\. Tumor Segmentation
disp('20. Segmenting tumors...'); %[output:1b18f390]
% sliceForTumorROI = bilat_filtered_for_tumors(:,:,157);
% [manualTumorLower, manualTumorUpper] = visualization.getThresholdsFromRoiInteractive(sliceForTumorROI, 'Draw ROI on Tumor for Thresholds');
% config.tumorSeg.lowerThreshold = manualTumorLower;
% config.tumorSeg.upperThreshold = manualTumorUpper;
% fprintf('Using tumor thresholds from ROI: Lower=%.3f, Upper=%.3f\n', config.tumorSeg.lowerThreshold, config.tumorSeg.upperThreshold);

finalTumorMask = segmentation.segmentTumors(... %[output:group:61e81f64] %[output:5c526937]
    bilat_filtered_for_tumors, ... %[output:5c526937]
    finalProcessedLiverMask, ... %[output:5c526937]
    config.tumorSeg.lowerThreshold, ... %[output:5c526937]
    config.tumorSeg.upperThreshold, ... %[output:5c526937]
    config.tumorSeg.minTumorVolumeVoxels, ... %[output:5c526937]
    config.tumorSeg.openStrelSphereRadius, ... %[output:5c526937]
    config.tumorSeg.closeStrelDiskRadius2D, ... %[output:5c526937]
    config.tumorSeg.connectivity3D, ... %[output:5c526937]
    config.maxValue, ... %[output:5c526937]
    config.verbose, ... %[output:5c526937]
    config.pauseDuration, ... %[output:5c526937]
    labelVolume); %[output:group:61e81f64] %[output:5c526937]
%%
if config.verbose %[output:group:4fc65813]
    visualization.viewVolumeSlices(bilat_filtered_for_tumors, finalTumorMask, ... %[output:66096a2c]
        'Final Tumor Mask vs Filtered Volume for Tumors', ... %[output:66096a2c]
        config.pauseDuration); %[output:66096a2c]
end %[output:group:4fc65813]
%%
%[text] ### Evaluation
disp('--- Evaluating Segmentation ---'); %[output:47c713fb]
%%
%[text] 21\. Calculate Metrics
[metrics, predictionVolume] = evaluation.calculateSegmentationMetrics(...
    labelVolume, ...
    finalProcessedLiverMask, ...
    finalTumorMask);
evaluation.displayMetrics(metrics); %[output:9cd88f94]

if config.verbose %[output:group:4eabb84d]
    disp('Visualizing comparison: GT vs. Prediction...'); %[output:16289625]
    baseImgForComparison = bilat_filtered_for_tumors;
    visualization.displaySegmentationComparisonGUI(...
        baseImgForComparison, ...
        labelVolume, ...
        predictionVolume);
    % visualization.plotSegmentationAndGT(baseImgForComparison, labelVolume, finalProcessedLiverMask, finalTumorMask, 'Segmentation vs Ground Truth', config.pauseDuration);
end %[output:group:4eabb84d]
%%
%[text] ### 3D Reconstruction
%%
if config.verbose %[output:group:0b5e51fc]
    disp('--- Performing 3D Reconstruction ---'); %[output:472c375e]
    bones_mask_for_3d = morph_ops.openVolume(...
        bones_mask_viz, ...
        strel('sphere', 2));

    visualization.render3DSegmentation(... %[output:7b1173d7] %[output:07c2ff29]
        finalProcessedLiverMask, ... %[output:7b1173d7] %[output:07c2ff29]
        finalTumorMask, ... %[output:7b1173d7] %[output:07c2ff29]
        bones_mask_for_3d, ... %[output:7b1173d7] %[output:07c2ff29]
        config.recon3D); %[output:7b1173d7] %[output:07c2ff29]
end %[output:group:0b5e51fc]
%%
disp("Liver Segmentation Pipeline Finished");

